script: |
  super -f text -I q1923.spq | sort > q1923.out

inputs:
  - name: q1923.spq
    data: |
      SELECT DISTINCT - 0 * - + COUNT ( * ) + - 18 AS col1, COUNT ( * ) + - COUNT ( * ) - + 76 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q1923.out
    data: |
      -18	-76
